import React, { useState } from 'react';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import Dish from './dishIItem';
import Favourites from './favourites';
import AddCustomDish from './addCustomDish';



function TopBar() {
    let displ = null;
    const [activeTab, setactiveTab] = useState('randomDish');

    if (activeTab === 'favourites') {
        displ = <Favourites />;
    }
    if (activeTab === 'randomDish') {
        displ = <Dish />;
    }
    if (activeTab === 'addCustomDish') {
        displ = <AddCustomDish />;
    }

    return (
        <div className='container'>
            <div className="topBar">
                <Stack direction="row" spacing={2}>
                    <Button variant="outlined" onClick={() => setactiveTab('randomDish')} > Random dish </Button>
                    <Button variant="outlined" onClick={() => setactiveTab('favourites')} > Favourites </Button>
                    <Button variant="outlined" onClick={() => setactiveTab('addCustomDish')} > Add custom dish </Button>
                </Stack>
            </div >
            <div>
                {displ}
            </div>
        </div>
    )
}


export default TopBar;
